import React from "react";
import { Projects } from "../components/Projects";

function ProjectInfo() {
  return (
    <div>
      {Object.values(Projects).map((project, idx) => (
        <div>
          <div>{project.name}</div>
          <div>{project.description}</div>
        </div>
      ))}
    </div>
  );
}

export default ProjectInfo;
